import React from 'react';
import Menu from '../../components/Menu';
import TabelaPedidos from '../../components/TabelaPedidos';
import Titulo from '../../components/Titulo';
import './index.css';

function Home() {
    return (
        <div>
            <Menu />
            <Titulo name='Pedidos' />
            <div className={'Container'} style={{margin:'0px 10px'}}>
                <TabelaPedidos />
            </div>
        </div>

    );
}

export default Home;
